pragma solidity >=0.6.0;
contract TwitterClone{

  string public name = 'twitter_clone';
  mapping(uint=>Tweet) private tweets;
  uint16 public tweetCount = 0;

  struct likedAddresses{
    address likesAdress;
  }
  mapping(uint16=>likedAddresses[]) public likes; //change the modifier later
  uint16 public likeCount = 0;

  struct Tweet{
    uint16 id;
    address payable author;
    string content;
    uint256 date;
    uint16 likes;
  }
  event tweetCreated(
    uint16 id,
    address payable author,
    string content,
    uint256 date,
    uint16 likes
  );

  function addTweet(string memory _content, uint256 _date) public {
    require(bytes(_content).length>0, 'content is empty');
    require(_date>0, 'date is empty');
    tweets[tweetCount] = Tweet(tweetCount, payable(msg.sender), _content, _date, likeCount);
    emit tweetCreated(tweetCount, payable(msg.sender), _content, _date, likeCount);
    tweetCount++;
  }
}
